                    "_id": "5f8875955626d97da2f6677b",
        "username": "jhon3423",
        "password": "jh342",
        "name": "Jhon ali",
        "token": null,
        "roleId": "5f85e908af7f03eddda15610",
        "createdAt": "2020-10-15T16:15:17.623Z",
        "updatedAt": "2022-04-08T20:20:20.262Z",
                    </tr>
                    </thead>
                    <tbody class="">
                    <tr class="">
                            <td class="">{user._id}</td>
                            <td class="">{user.username}</td>
                            <td class="">{user.password}</td>
                            <td class="">{user.name}</td>
                            <td class="">{user.roleId}</td>
                            <td class="">{user.createdAt}</td>
                            <td class="">{user.updatedAt}</td>
                         </tr>
                        </tbody>
                     </table>
                     )
                    })
}
		</div>

	)
}

export default UserManagement;
